# Partial-Key Recovery Attack Using Model_SK
def attack_in_SingleKey(B,Chosen_NIndex):
	'''
	Chosen_NIndex denotes log(N) here, where N is the data complexity you want to use to mount this attack.
	'''
	CorKind=[0 for i in range(len(PreComputed[6]))]
	for i in range(len(PreComputed[6])):
		CorKind[i]=PreComputed[6][i]
	for i in range(len(CorKind)):
		CorKind[i]=CorKind[i]*(2**(-PreComputed[4]))
	TotalClassNum=len(CorKind)
	Pe_Each=[0 for ClassNum in range(TotalClassNum)]
	KeyInKeyClass=PreComputed[7]
	Pr_Each=[0 for ClassNum in range(TotalClassNum)]
	
	N=2**(Chosen_NIndex)
	TotalPe=0
	ObtainedKeyInfo=0
	for ClassNum in range(TotalClassNum):
		Pe_Each[ClassNum]=0
		if ClassNum==0 or ClassNum==TotalClassNum-1:
			if ClassNum==0:
				for j in range(TotalClassNum):
					if j!=ClassNum:
						Pe_Each[ClassNum]+=(stats.norm.cdf((N**0.5)*((CorKind[ClassNum]+CorKind[ClassNum+1])/2.0-CorKind[j])/(((B*(1-(CorKind[i])**2))**0.5)*1.0)))
			else:
				for j in range(TotalClassNum):
					if j!=ClassNum:
						Pe_Each[ClassNum]+=(1-stats.norm.cdf((N**0.5)*((CorKind[ClassNum]+CorKind[ClassNum-1])/2.0-CorKind[j])/(((B*(1-(CorKind[i])**2))**0.5)*1.0)))
		else:
			for j in range(TotalClassNum):
				if j!=ClassNum:
					Pe_Each[ClassNum]+=(stats.norm.cdf((N**0.5)*((CorKind[ClassNum]+CorKind[ClassNum+1])/2.0-CorKind[j])/(((B*(1-(CorKind[i])**2))**0.5)*1.0))-stats.norm.cdf((N**0.5)*((CorKind[ClassNum]+CorKind[ClassNum-1])/2.0-CorKind[j])/(((B*(1-(CorKind[i])**2))**0.5)*1.0)))
		Pr_Each[ClassNum]=len(KeyInKeyClass[ClassNum])/((2**PreComputed[5])*1.0)
		TotalPe+=(Pr_Each[ClassNum]*Pe_Each[ClassNum])
		ObtainedKeyInfo+=(-1*Pr_Each[ClassNum]*math.log(Pr_Each[ClassNum])/math.log(2))
	print("Chosen_NIndex=",Chosen_NIndex," Using 2**("+str(Chosen_NIndex)+") data in total and then ",end='')
	print("we can obtain",ObtainedKeyInfo,"bits key information with Success Probability",1-TotalPe,".")

# Partial-Key Recovery Attack Using Model_RK
def attack_in_RelatedKey(B,Chosen_NIndex,KeyDiff):
	'''
	Chosen_NIndex denotes log(N) here, where N is the data complexity you want to use to mount this attack.
	KeyDiff is the key differences you want to use.
	'''
	CorKind=[0 for i in range(len(PreComputed[6]))]
	for i in range(len(PreComputed[6])):
		CorKind[i]=PreComputed[6][i]
	KeyInKeyClass=PreComputed[7]
	tmpCor=0
	diff=KeyDiff
	CorKind_RK=[]
	KeyInKeyClass_RK=[]
	for i in range(len(KeyInKeyClass)):
		for j in range(len(KeyInKeyClass[i])):
			i_another=getKeyClass(KeyInKeyClass[i][j]^diff,KeyInKeyClass)
			tmpCor=CorKind[i]-CorKind[i_another]
			exist=False
			for ClassNum in range(len(CorKind_RK)):
				if tmpCor==CorKind_RK[ClassNum]:
					KeyInKeyClass_RK[ClassNum].append(KeyInKeyClass[i][j])
					exist=True
					break
			if not exist:
				CorKind_RK.append(tmpCor)
				KeyInKeyClass_RK.append([KeyInKeyClass[i][j]])
	Sorted=[[0,[]] for ClassNum in range(len(CorKind_RK))]
	for ClassNum in range(len(CorKind_RK)):
		Sorted[ClassNum][0]=CorKind_RK[ClassNum]
		Sorted[ClassNum][1]=KeyInKeyClass_RK[ClassNum]
	Sorted.sort(key=takeFirst)
	for ClassNum in range(len(CorKind_RK)):
		CorKind_RK[ClassNum]=Sorted[ClassNum][0]*(2**(-PreComputed[4]))
		KeyInKeyClass_RK[ClassNum]=Sorted[ClassNum][1]
	TotalClassNum=len(CorKind_RK)
	Pe_Each=[0 for ClassNum in range(TotalClassNum)]
	Pr_Each=[0 for ClassNum in range(TotalClassNum)]
	
	N=2**(Chosen_NIndex)
	TotalPe=0
	ObtainedKeyInfo=0
	has_solution=False
	for ClassNum in range(TotalClassNum):
		Pe_Each[ClassNum]=0
		if ClassNum==0 or ClassNum==TotalClassNum-1:
			if ClassNum==0:
				for j in range(TotalClassNum):
					if j!=ClassNum:
						Pe_Each[ClassNum]+=(stats.norm.cdf((N**0.5)*((CorKind_RK[ClassNum]+CorKind_RK[ClassNum+1])/2.0-CorKind_RK[j])/(((2*B)**0.5)*1.0)))
			else:
				for j in range(TotalClassNum):
					if j!=ClassNum:
						Pe_Each[ClassNum]+=(1-stats.norm.cdf((N**0.5)*((CorKind_RK[ClassNum]+CorKind_RK[ClassNum-1])/2.0-CorKind_RK[j])/(((2*B)**0.5)*1.0)))
		else:
			for j in range(TotalClassNum):
				if j!=ClassNum:
					Pe_Each[ClassNum]+=(stats.norm.cdf((N**0.5)*((CorKind_RK[ClassNum]+CorKind_RK[ClassNum+1])/2.0-CorKind_RK[j])/(((2*B)**0.5)*1.0))-stats.norm.cdf((N**0.5)*((CorKind_RK[ClassNum]+CorKind_RK[ClassNum-1])/2.0-CorKind_RK[j])/(((2*B)**0.5)*1.0)))
		Pr_Each[ClassNum]=len(KeyInKeyClass_RK[ClassNum])/((2**PreComputed[5])*1.0)
		TotalPe+=(Pr_Each[ClassNum]*Pe_Each[ClassNum])
		ObtainedKeyInfo+=(-1*Pr_Each[ClassNum]*math.log(Pr_Each[ClassNum])/math.log(2))
	if TotalPe<=0.2:
		has_solution=True
		print("Chosen_NIndex=",Chosen_NIndex," Using 2**("+str((Chosen_NIndex+1))+") data in total and ",end='')
		print("keyDiff=0x%X"%(diff)," : we can obtain",ObtainedKeyInfo,"bits key information with Success Probability",1-TotalPe,".",(ObtainedKeyInfo*(1-TotalPe)))
	if not has_solution:
		print("Chosen_NIndex=",Chosen_NIndex,"We cannot attack TinyJAMBU with success probability bigger than 80% under 2**("+str((Chosen_NIndex+1))+") data in total and key difference 0x%X" %(diff),".")

